const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <div id={AwParseService.instance( "subPanelContext.menuContainerId" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} className="aw-splm-tableMenuContainer afx-content-background aw-hierarchical-popup">
        <div id={AwParseService.instance( "subPanelContext.menuId" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} className="aw-splm-tableMenu aw-splm-tableMenuPopup" role="menu">
            <div>
                <AwPopupCommandBar anchor={AwParseService.instance( "subPanelContext.anchor" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} context={AwParseService.instance( "subPanelContext" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} own-popup="true">
                </AwPopupCommandBar>
            </div>
            <hr>
            </hr>
            <DivExistWhen className="aw-splm-tableMenuItem aw-widgets-cellTop column-filter-container" role="menuitem" existWhen={AwParseService.instance( "conditions.filteringEnabled" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                <div className="column-filter">
                    <div className="text-filter">
                        <div>
                            <AwFlexRow height="2f">
                                <AwLink dataprovider={AwParseService.instance( "data.dataProviders.operationsDataProvider" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} {...getField("operation", fields, $index, null, null )} linkOptions={AwParseService.instance( "data._linkOptions_operationsLink" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                                </AwLink>
                            </AwFlexRow>
                        </div>
                        <AwSearchBox {...getField("textValue", fields, $index, null, null )} placeholder={AwParseService.instance( "{{i18n.searchText}}" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} action={actions.filterAction}>
                        </AwSearchBox>
                    </div>
                </div>
                <DivExistWhen className="facet-filter-container" existWhen={AwParseService.instance( "subPanelContext.hasFilterFacetAction" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                    <div className="facets-container">
                        <AwTogglebutton className="facet-toggle" {...getField("data.showFilters", fields, $index, null, null )} action={actions.showFiltersToggleChangedBatch}>
                        </AwTogglebutton>
                        <DivExistWhen className="facet-filter" existWhen={AwParseService.instance( "conditions.isShowFiltersSelected" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                            <AwFlexColumn>
                                <AwFlexRow>
                                    <AwLabelExistWhen {...getField("noMatchesFound", fields, $index, null, null )} existWhen={AwParseService.instance( "conditions.noFacetResults" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
