                                        </AwListCheckboxItem>
                                    </AwList>
                                </AwFlexRow>
                            </AwFlexColumn>
                        </DivExistWhen>
                    </div>
                </DivExistWhen>
                <div className="submit-buttons-filter">
                    <AwFlexRow height="2.75f">
                        <div className="sw-column w-6 column-menu-button">
                            <AwButtonAwClass id="columnMenuClearButton" buttonType="negative" action={actions.clearFilter} awClass={AwParseService.instance( "{'disabled': subPanelContext.gridContext.columnDef.filter.isFilterApplied !== true}" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                                <AwI18n>
                                    {i18n.clearButtonTitle}
                                </AwI18n>
